import React, { Fragment } from "react";

import { Layout } from "antd";
const PersonalCabinet = () => {
  return (
    <Fragment>
      <Layout>
        <Layout.Content style={{ margin: "5em 16px" }}>
          <div
            style={{
              background: "#fff",
              padding: 44,
              minHeight: 380
            }}
            className="border border-info"
          ></div>
        </Layout.Content>
      </Layout>
    </Fragment>
  );
};

export default PersonalCabinet;
